  selector: 'dbz-list',
  templateUrl: './list.component.html',
  styleUrls: ['./list.component.css']
})
export class ListComponent {

  @Input()
  public characterList: Character[] = [{
    name:'Trunks',
    power: 1000
  }];
}
<h4>Listado</h4>
<ul class="list-group">
  <li class="list-group-item">Krillin - 500</li>
  <li class="list-group-item">Goku - 10,000</li>
